import React, { useState, useEffect } from "react";
export default function Card(props){
    const [pokemonData, setPokemonData] = useState({});
    useEffect(() => {
        setPokemonData(props.pokemon)
    })
    return (
        <div>
            <p>{pokemonData.Name}</p>
            <p>{pokemonData.Type}</p>
            <p>{pokemonData.ID}</p>
            <p>{pokemonData.img}</p>
        </div>
    )
}
